import TextField from "../Components/TextField.jsx";
import { React } from "react";

function InformationSpecial() {

    return (
        <div>

            <h1 style={Styles.TitleText}>YOUR INFORMATION</h1><br />

            <TextField action="Enter" label="First Name" />
            <TextField action="Enter" label="Last Name" />
            <TextField action="Enter" label="Email Address" />
            <TextField action="Confirm" label="Email" />
            <TextField action="Enter" label="Phone Number" />
            <TextField action="Enter" label="Address" />
            <TextField action="Enter" label="City" />
            <TextField action="Enter" label="State" />
            <TextField action="Enter" label="ZIP" />
            <TextField action="Enter" label="Event Description" />

            <button style={Styles.Buttons}>Next: Select Package</button>

            <p>Booking TIME on DATE</p>

            <button style={Styles.Buttons}>Change or Cancel</button>

        </div>
    )
}

export default InformationSpecial;

const Styles = {

    Setup: {
        backgroundColor: 'white',
        alignItems: 'center',
    },

    Buttons: {
        backgroundColor: 'orange',
        margin: 10,
    },

    ButtonText: {
        textAlign: 'center',
    },

    SelectionView: {
        borderWidth: 4,
        padding: 5,
        paddingBottom: 10,
        margin: 10,
    },

    HeaderText: {
        fontWeight: 'bold',
        textSize: 25,
    },

    TitleText: {
        fontSize: 40,
        paddingBottom: 50,
        color: 'grey',
        textAlign: 'center',
    },

    Input: {
        padding: 5,
        margin: 20,
        borderWidth: 1,
    },

    Header: {
        padding: 20,
        textAlign: 'center',
        fontSize: 20,
    },

    InputPrompt: {
        color: 'orange',
        fontSize: 15,
        margin: 30,
    }
}
